  true,\n\t\"url\": null,\n\t\"notes\": \"Small Business Lending in the United States,
  published by the SBAu2019s Office of Advocacy annually since 1994, looks at small
  business lending locally and nationally using two types of data supplied by depository
  institutions to their respective regulating agenciesu2014Call Reports for June 2011
  and Community Reinvestment Act (CRA) reports for 2010. The annual banking study
  includes cooperative banks in addition to existing depository institutions and gives
  a brief review on the institution lending patterns in 2010 and 2011. The rankings
  and performance of these lenders are summarized and organized by state/ territory,
  loan size, number of loans, and asset size of the institution. The Small Business
  Lending tables use the call report data to rank all lenders by state.\",\n\t\"license_title\":
